    true,nt"url": null,nt"notes": "China County-Level Data on Population (Census)
    and Agriculture, Keyed To 1:1M GIS Map consists of census, agricultural economic,
    and boundary data for the administrative regions of China for 1990. The census data
    includes urban and rural residency, age and sex distribution, educational attainment,
    illiteracy, marital status, childbirth, mortality, immigration (since 1985), industrial/economic
    activity, occupation, and ethnicity. The agricultural economic data encompasses
    rural population, labor force, forestry, livestock and fishery, commodities, equipment,
    utilities, irrigation, and output value. The boundary data are at a scale of one
    to one million (1:1M) at the county level. This dataset is produced in collaboration
    with the University of Washington as part of the China in Time and Space (CITAS)
    project, University of California-Davis China in Time and Space (CITAS) project,
    and the Columbia University Center for International Earth Science Information Network
    (CIESIN).",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
